import React from "react";
import { Container } from "react-bootstrap";
import Beitrag from "../Beitrag";

const BeitragDeck = (props) => {
  let beitraege = props.data
  if(beitraege === undefined || beitraege === 0)return(<h3 className = "m-5">Beitraege nicht geladen</h3>);
  return (
    <Container className = {props.className2}>
        {beitraege.map((e,i) => {
          return (<Beitrag key = {i+"beitrag"} name = {e.ueberschrift} text = {e.text} img = {e.img} />)
        })}
      </Container>
  );
};

export default BeitragDeck;
